import React from 'react'

export default function Sneaker(props) {

    const sneakerImage = props.img

    return (
        <div className='sneaker'>
            <img 
                src={sneakerImage}
                alt={props.model}
            />
            <h3>{props. model}</h3>
            <img 
                src={`../assets/images/logos/${props.source_site}`}
                alt={props.source_site}
            />
        </div>
    )
}
